import * as React from 'react';
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import ShiftsDataGrid from "./ShiftsDataGrid";
import { styled } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import NurseAssignmentDialog from './NurseAssignmentDialog';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));


export default function ShiftsListingPage() {
 const [open, setOpen] = React.useState(false);

 const handleClickOpen = () => {
   setOpen(true);
 };

  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
        <Grid container direction="column">
          <Grid>
            <Item>
              <Button variant="outlined" click={handleClickOpen}>
                Set Shift Assignment
              </Button>
            </Item>
            <Item>
              <ShiftsDataGrid></ShiftsDataGrid>
            </Item>
          </Grid>
        </Grid>
      </Box>
      <NurseAssignmentDialog open={open}>
      </NurseAssignmentDialog>
    </div>
  );
}
